import React from "react";

interface FoodCardProps {
  image: string;
  title: string;
  price: string;
  rating: number;
  quantity: string;
  description: string;
}

export const FoodCard: React.FC<FoodCardProps> = ({
  image,
  title,
  price,
  rating,
  quantity,
  description,
}) => {
  const renderStars = (rating: number) => {
    const stars = [];
    for (let i = 0; i < 5; i++) {
      const starImage =
        i < Math.floor(rating)
          ? "https://api.builder.io/api/v1/image/assets/TEMP/b8a2cafbefb30d676a3a64694d2ad2a66ddbaafd?placeholderIfAbsent=true&apiKey=b59f74ae8c9444f28ee33eff06842d33"
          : i === Math.floor(rating) && rating % 1 !== 0
          ? "https://api.builder.io/api/v1/image/assets/TEMP/28d816dd0284c5d984c359268f23d1ea6cbde4dc?placeholderIfAbsent=true&apiKey=b59f74ae8c9444f28ee33eff06842d33"
          : "https://api.builder.io/api/v1/image/assets/TEMP/e03d566e8e9efb90a605329987f67fffd24c38ba?placeholderIfAbsent=true&apiKey=b59f74ae8c9444f28ee33eff06842d33";

      stars.push(
        <img
          key={i}
          src={starImage}
          className="object-contain shrink-0 w-3.5 rounded-2xl aspect-[1.08]"
          alt="star"
        />,
      );
    }
    return stars;
  };

  return (
    <article className="flex flex-col justify-between h-[400px] w-full rounded-2xl bg-zinc-300 overflow-hidden">
  <img
    src={image}
    className="object-cover w-full h-40 rounded-t-2xl"
    alt={title}
  />
  <div className="flex flex-col px-3 py-4 grow">
    <div className="flex justify-between items-start">
      <div className="flex flex-col text-xl font-bold text-black">
        <h3>{title}</h3>
        <div className="mt-1.5">{price}</div>
      </div>
      <div className="flex flex-col items-end">
        <div className="flex gap-px">{renderStars(rating)}</div>
        <div className="mt-2 text-xl font-bold text-black">{quantity}</div>
      </div>
    </div>
    <p className="mt-auto text-lg text-black">{description}</p>
  </div>
</article>

  );
};
